import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Form.scss'; // Reuse the existing CSS
import Navbar from './../Navbar/Navbar';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const SessionForm = () => {
  const [sessionData, setSessionData] = useState({
    topic: '',
    date: '',
    time: '',
    isPaid: false,
    price: '',
    status: 'active'
  });

  const handleInput = (e) => {
    const { name, value, type, checked } = e.target;
    setSessionData({
      ...sessionData,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const { topic, date, time, isPaid, price, status } = sessionData;

    // Make an API call to post the session
    const response = await fetch('/api/session/create', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ topic, date, time, isPaid, price, status })
    });

    const json = await response.json();
    if (!response.ok) {
      toast.error(json.error, { position: 'top-right', autoClose: 5000 });
    } else {
      toast.success('Session created successfully!', { position: 'top-right', autoClose: 5000 });
    }
  };

  return (
    <>
      <Navbar isLogin="false" />
      <ToastContainer />
      <div className="form-body">
        <div className="form-box">
          <div className="form-header">
            <h3>Create Session</h3>
          </div>
          <div className="form-inner-body">
            <form method="post" onSubmit={handleSubmit}>
              <div className="input-group">
                <input
                  value={sessionData.topic}
                  onChange={handleInput}
                  type="text"
                  placeholder="Session Topic"
                  name="topic"
                  id="topic"
                />
                <label htmlFor="topic">Topic</label>
              </div>
              <div className="input-group">
                <input
                  value={sessionData.date}
                  onChange={handleInput}
                  type="date"
                  placeholder="Date"
                  name="date"
                  id="date"
                />
                <label htmlFor="date">Date</label>
              </div>
              <div className="input-group">
                <input
                  value={sessionData.time}
                  onChange={handleInput}
                  type="time"
                  placeholder="Time"
                  name="time"
                  id="time"
                />
                <label htmlFor="time">Time</label>
              </div>
              <div className="input-group">
                <input
                  type="checkbox"
                  checked={sessionData.isPaid}
                  onChange={handleInput}
                  name="isPaid"
                  id="isPaid"
                />
                <label htmlFor="isPaid" className="checkbox">
                  Paid Session
                </label>
              </div>
              {sessionData.isPaid && (
                <div className="input-group">
                  <input
                    value={sessionData.price}
                    onChange={handleInput}
                    type="number"
                    placeholder="Price"
                    name="price"
                    id="price"
                  />
                  <label htmlFor="price">Price</label>
                </div>
              )}
              <div className="input-group">
                <select
                  value={sessionData.status}
                  onChange={handleInput}
                  name="status"
                  id="status"
                >
                  <option value="active">Active</option>
                  <option value="inactive">Inactive</option>
                  <option value="completed">Completed</option>
                </select>
                <label htmlFor="status">Status</label>
              </div>
              <div className="input-group">
                <button className="btn" type="submit">
                  Create Session
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </>
  );
};

export default SessionForm;
